import React, { useEffect, useState } from 'react';
import './App.css';
import {Todos} from './components/todos/Todos';
import LoadingComponent from './components/todos/Loading';
import axiosInstance from './axios';

function App() {
	const PostLoading = LoadingComponent(Todos);
	const [appState, setAppState] = useState({
		loading: true,
		todos: null,
	});

	useEffect(() => {
		axiosInstance.get().then((res) => {
			const alltodos = res.data;
			console.log(res.data);
			setAppState({ loading: false, todos: alltodos });
			console.log(res.data);
		});
	}, [setAppState]);
	return (
		<div className="App">
			<h1>Latest Todos</h1>
			<PostLoading isLoading={appState.loading} todos={appState.todos} />
		</div>
	);
}
export default App;
